import  React  from "react";
import {ProgressBar} from 'primereact/progressbar';


class Rates extends React.Component{
    constructor()
    {
        super();
    }

    componentDidMount(){
        this.structureData();
    }

    structureData(){
         console.log(this.props.data,"cons");
         let active = {},recovered={},deaths={};
         let totalConfirmed = this.props.data.total.recovered[this.props.data.total.recovered.length-1];
         let totalRecovered = this.props.data.total.recovered[this.props.data.total.recovered.length-1];
         let totalDeaths = this.props.data.total.deaths[this.props.data.total.deaths.length-1];

         let totalActive = totalConfirmed-totalRecovered-totalDeaths;
        //find the highest active cases rate

        Object.keys(this.props.data.data).forEach((x,index)=>{
                if(index==0){
                    active[x]=this.props.data.data[x].confirmed[this.props.data.data[x].confirmed.length-1][1];
                    recovered[x]=this.props.data.data[x].recovered[this.props.data.data[x].recovered.length-1][1];
                    deaths[x]=this.props.data.data[x].deaths[this.props.data.data[x].deaths.length-1][1];
                }
                else{
                if(parseInt(Object.values(active))<= this.props.data.data[x].confirmed[this.props.data.data[x].confirmed.length-1][1])
                    active[Object.keys(active).toString()]=this.props.data.data[x].confirmed[this.props.data.data[x].confirmed.length-1][1];

                if(parseInt(Object.values(recovered))<= this.props.data.data[x].recovered[this.props.data.data[x].recovered.length-1])
                   recovered[Object.keys(recovered).toString()]=this.props.data.data[x].recovered[this.props.data.data[x].recovered.length-1][1];

                if(parseInt(Object.values(deaths))<= this.props.data.data[x].deaths[this.props.data.data[x].deaths.length-1])
                    deaths[Object.keys(deaths).toString()]=this.props.data.data[x].deaths[this.props.data.data[x].deaths.length-1][1];
                }
        })  
    console.log("",recovered,deaths,active)

    }


    render(){
        return(
            <div className="col-xl-3 col-md-12">
              <div className="card" style={{height:"360px"}}>
                <div className="card-body">
                    <span>Highest Active Rate</span><hr style={{color:"blue"}}></hr>
                    <span style={{float:"left",fontWeight:"bold"}}>United States</span>
                    <span style={{float:"right",color:"blue",fontWeight:"bold"}}>70%</span><br></br><br></br>
                    <span>Highest Recovery Rate</span><hr></hr>
                    <span style={{float:"left",fontWeight:"bold"}}>India</span>
                    <span style={{float:"right",color:"green",fontWeight:"bold"}}>50%</span><br></br><br></br>
                    <span>Highest Death Rate</span><hr></hr>
                    <span style={{float:"left",fontWeight:"bold"}}>United States</span>
                    <span style={{float:"right",color:"red",fontWeight:"bold"}}>40%</span>

                </div>
              </div>
            </div>
        )
    }
}

export default Rates;
